description:
This is a text file with the script for CEX Clone 3.0 for messenger plus. You NEED Messenger Plus installed first before you can use this script! 

To use it go to show menu on the messenger window &gt; 

scroll to plus &gt; 

click preferences and options &gt; 

on the general tab click scripts on the left hand side &gt; 

then in the developers only box click create new &gt;

enter the name CEX Clone 3.0 then delete everything in the window that appears &gt; 

then open your text file and copy and paste the entire text into the script window&gt; 

then click save all at the bottom and your done :-D

Enjoy
